import React, { Component } from 'react';

import './App.css';

const white_div = {
  backgroundColor: 'white',
  height: 'auto',
  width: '100%',
  position: 'absolute',
  fontSize: 14,
  color: 'black',
  display: 'inlineBlock',
  float: 'right',


};
const booknow={
  backgroundColor:'yellow',
  color:'black',
  height:'auto',
  width:'auto',
  margin:'5',


  textAlign:'center'
};
const div1={
  alignContent: "right",
  backgroundColor:"white",
  height: "auto",
  overflow:"auto", 
  width: "100%"
};
const div2={
  float:"right",

  color: "white",
  margin:7,
  height: "auto",
  width: "auto"
}


class SecondNavbar extends Component {
    render() {
        return (
          <div>
           <div  className="App" style={white_div} >
            <div style={div1}>

              <div  style={div2  }><a className="App" id="a2"href="https://www.olacabs.com/">Book Now  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  </a> </div>
              <div style={div2}><a id="a1"href="https://www.olacabs.com/">Offddfgdfgders  &nbsp; |   </a>  </div>
              <div style={div2}><a id="a1"href="https://www.olacabs.com/">Shadfgdre   &nbsp; |</a>    </div>
              <div style={div2}><a id="a1"href="https://www.olacabs.com/">Ola Cordfgdfgporate &nbsp; | </a>    </div>
              <div style={div2}><a id="a1"href="https://www.olacabs.com/">Ola Mongdgdfgey   &nbsp;|</a> </div>
              <div style={div2}><a id="a1"href="https://www.olacabs.com/">Drive with.,fsdf.sf,.s Ola     &nbsp; |      </a>     </div>

            </div>
          </div> 


          </div>
        );
      }
    }


export default SecondNavbar;
